import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'
function DataFetingPhoto({ card }) {
  const [common, setCommon] = useState([0])
  const { id } = useParams

  useEffect(() => {
    function photo() {
      const commons = card.map(result => result.common)
      for (let common of commons) {
        setCommon(common)
      }
    }
    photo()
  })
  console.log(common)
  return (
    <div>
      <ul>
        {common.map((common, i) => (
          <li key={i} id={common.id}>
            {common.invited_people && common.invited_people.username[i]}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default DataFetingPhoto
